class Solution(object):
    def evalRPN(self, tokens):
        """
        :type tokens: List[str]
        :rtype: int
        """
        if tokens:
            left = []
            for i in tokens:
                if i == '+':
                    left.append(left[-2] + left[-1])
                    left.pop(-2)
                    left.pop(-2)
                elif i == '-':
                    left.append(left[-2] - left[-1])
                    left.pop(-2)
                    left.pop(-2)
                elif i == '*':
                    left.append(left[-2] * left[-1])
                    left.pop(-2)
                    left.pop(-2)
                elif i == '/':
                    left.append(int(float(left[-2])/left[-1]))
                    left.pop(-2)
                    left.pop(-2)

                else:
                    left.append(int(i))
            return int(left[0])
        else:
            return 0
